import React from 'react'

function MovieRec(props) {
    //userGenreList = props.userGenreList
    const userGenreList = ['romantic', 'adventure', 'sci-fi', 'suspense', 'anime']


    function textToBeDisplayed() {
        const userGenre = userGenreList[Math.random() * userGenreList.length].toString() //randomly choose a user genre to recommend
        return userGenre
    }
    return (
        <>
            <div>
                <li>{userGenreList.toString()}</li>
                <h1>{textToBeDisplayed()}</h1>
            </div>
        </>
    )

}

export default MovieRec
